import styled from "styled-components";

const Layout = ({ children }) => {
  return;
  <Wrapper>
    <Container>{children}</Container>
  </Wrapper>;
};

const Wrapper = styled.div`
  width: 100%;
  height: 100vh;
`;

const Container = styled.div`
  color: #333;
  background: yellow;

  max-width: 36rem;
  padding: 0 1rem;
  margin: 3rem auto 6rem;
`;

export default Layout;
